from Crypto.Util.number import *

s = ""


def decode(s, n):
    bits = ""
    for chk in [s[i : i + n] for i in range(0, len(s), n)]:
        if chk.count("0") > chk.count("1"):
            bits += "0"
        else:
            bits += "1"
    return bits


print(long_to_bytes(int(decode(s, 3), 2)))
